import React from "react";
import './Stil.css';

class Home extends React.Component {
  render() {
    return (
      <div className="main-div">
        
        <div className="table-responsive" id="tabelica-div">
            <table className="table table-hover" id="tabelica">
              <thead>
                <tr>
                  <th scope="col">ŠEJLA PLJAKIĆ</th>
                </tr>
              </thead>
            </table>
            <br />
          </div>
          <br />
          <p id="info">▪ Inspiring, a mission-driven enthusiast who can help you to create or adapt customized applications with reusable and maintainable components for clients or other organizations.
▪ A proactive contributor who listens to clients needs and works with engineering and programming skills to analyze, define, design and implement complex, distributed software systems to meet those needs.              ▪ A passionate innovator and problem solver who helps others to be unique and to use their full potential and to get customer trust.   
<a href="/about-me" style={{color: "rgb(56, 204, 192)"}}>click here.</a>
          </p>
          <br />
          <button type="button" id="dugmic" className="btn btn-outline-secondary">Download my CV</button>
      </div>
    );
  }
}

export default Home;
